import { Layout, Image, Row, Col, Avatar, Input, Button, List, Space, Checkbox } from "antd";
import { SearchOutlined } from '@ant-design/icons';

import React from "react";

interface MyLearningProps { }
interface MyLearningState { }

const { Header, Content } = Layout;
const { Search } = Input;

class MyLearning extends React.Component<MyLearningProps, MyLearningState>{
    state = {}

    render() {
        return (
            <>
                <div>
                    <Layout className="mainLayout">
                        {/* Header */}
                        <Header className="mainHeader">
                            <Row justify="space-between">
                                <Col><Image
                                    preview={false}
                                    width={100}
                                    src="data:image/png;base64,"
                                />
                                </Col>
                                <Col>
                                    Hi, User <Avatar size="small" />
                                </Col>
                            </Row>
                        </Header>

                        {/* Content */}
                        <Content className="mainContent">
                            <Row>
                                <Col span={24}>
                                    <Row justify="space-between">
                                        <Col>
                                            <h3>My Learnings</h3>
                                        </Col>
                                        <Col>
                                            <Space>
                                                <Input className="searchBox" placeholder="Masukkan kata kunci" suffix={<SearchOutlined />} />
                                                <Button className="searchButton" type="primary">Search Class</Button>
                                            </Space>
                                        </Col>
                                    </Row>
                                    <Row>
                                        <Button>All</Button>
                                        <Button>Applied</Button>
                                        <Button>On-Progress</Button>
                                        <Button>Completed</Button>
                                        <Button>Bookmark</Button>
                                    </Row>
                                    <Row>
                                        <List></List>
                                    </Row>
                                </Col>
                            </Row>
                        </Content>
                    </Layout>
                </div>
            </>
        );
    }
}

export default MyLearning;
